import React from 'react';
import './Feature.css';

const Map = () => {
  return (
    <div className="feature-container">
      <h1>Interactive Map</h1>
      <p>
        The interactive map enables users to pinpoint exact locations of garbage,
        making it easier for city councils to locate and address issues.
      </p>
    </div>
  );
};

export default Map;
